import { useEffect, useState } from "react";
import axios from "axios";

export const History = () => {
    const [data, setData ] = useState('')
    useEffect(() => {
    async  function getData () {
        let getTransactionDetails = await axios.get(`https://localhost:44322/Transaction/transaction_receipts?accountNumber=6368345373`).then(response => console.logresponse).catch(err => console.log(err, 'error caught during post of account number '));

    }
    getData();
    }, [])
    return (<>
        div works!
    </>);
}
